import React, { Component } from 'react';
import './desktop.css';
import ReactDOM from 'react-dom';

class NombreUsuario extends Component {	
  	render() {
  	  	return (	  		  
  	  		<div class="NombreUsuario">HECTOR  DAVID MORALES </div>		    		
	    );
  	}
}

ReactDOM.render(<NombreUsuario />, document.getElementById('ContentUser'));

export default NombreUsuario
